import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_page.png'));

    // Find and click the "Your Profile" link to trigger the dynamic content
    const profileLinkLocator = page.getByRole('link', { name: 'Your Profile' }).first();
    await profileLinkLocator.waitFor({ state: 'visible', timeout: 5000 });
    await profileLinkLocator.click();

    // Wait for the profile section to be rendered
    const profilePageLocator = page.locator('.profile-page');
    await profilePageLocator.waitFor({ state: 'visible', timeout: 5000 });

    // Take a screenshot of the profile page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Extract user profile information
    const fullName = await page.locator('.profile-info h2').textContent();
    const username = await page.locator('p.username').textContent();
    const bio = await page.locator('p.bio').textContent();
    const totalOrders = await page.locator('.profile-stats .stat:nth-child(1) .stat-number').textContent();
    const totalReviews = await page.locator('.profile-stats .stat:nth-child(2) .stat-number').textContent();
    const sellerRating = await page.locator('.profile-stats .stat:nth-child(3) .stat-number').textContent();

    const extractedData = {
      fullName: fullName.trim(),
      username: username.trim(),
      bio: bio.trim(),
      stats: {
        totalOrders: parseInt(totalOrders, 10),
        totalReviews: parseInt(totalReviews, 10),
        sellerRating: parseFloat(sellerRating)
      }
    };

    return {
      success: true,
      action: "Successfully navigated to the profile page and harvested user information.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    // On failure, take a final screenshot if possible
    try {
      const errorScreenshotPath = path.join(screenshotsDir, 'error_screenshot.png');
      await page.screenshot({ path: errorScreenshotPath });
      screenshots.push(errorScreenshotPath);
    } catch (e) {
      // Ignore if screenshot fails
    }

    return {
      success: false,
      action: "Failed to harvest user profile information.",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
